import React from 'react';
import './Team.css';
import Nav from '../Content/BandeauHaut';

import {Row} from 'react-bootstrap';
import {Col} from 'react-bootstrap';
import {Container} from 'react-bootstrap';

export default class Team extends React.Component {
    
    render() {
        const elements = ['atlanta', 'boston', 'brooklyn', 'charlotte', 'chicago'];


        return(           
            <Container className="ballon" fluid>
                <Row>
                    <Nav/>
                </Row>
                
                <Row className="separer"></Row>
                {elements.map(item => {
        return <Col className={item} xs={2}>{item}</Col>
      })}
                {/* <Row className="rang">
                    <Col className="atlanta" xs={2}>

                    </Col>
                    <Col className="boston" xs={2}>
                        
                    </Col>
                    <Col className="brooklyn" xs={2}>
                        
                    </Col>
                    <Col className="charlotte" xs={2}>
                        
                    </Col>
                    <Col className="chicago" xs={2}>
                        
                    </Col>
                </Row> */}
                
                
                
            </Container>
        );
    }
}
